import React from 'react';
import d from './Dialog.module.css';
import { NavLink } from 'react-router-dom';

const Dialogitem = (props) => {
  let paf = '/dialog/' + props.id;
  return (
    <div className={d.dialog}>
      <NavLink to={paf}>{props.name}</NavLink>
    </div>
  );
};

const Message = (props) => {
  return <div className={d.msg}>{props.name}</div>;
};

const Dialog = (props) => {
  let person = [
    { name: 'Sasha', id: '1,' },
    { name: 'Tyom', id: '1,' },
    { name: 'Viktoria', id: '1,' },
    { name: 'Ann', id: '1,' },
    { name: 'Ani', id: '1,' },
  ];

  return (
    <div className={d.item}>
      <div className={d.dialogs}>
        <Dialogitem name='Sasha' id='1' />
        <Dialogitem name='Tyom' id='2' />
        <Dialogitem name='Viktoria' id='3' />
        <Dialogitem name='Ann' id='4' />
        <Dialogitem name='Ani' id='5' />
      </div>
      <div className={d.message}>
        <Message name='Hi' />
        <Message name='How is your komasutra?' />
        <Message name='Yo' />
      </div>
    </div>
  );
};

export default Dialog;
